export default function Target({order}) {

  const allowDrop = (event) => {
    event.preventDefault();
  }

  const drop = (event) => {
    event.preventDefault();
  }

  return (
    <div onDrop={() => drop(event)} onDragOver={() => allowDrop(event)} className="target">
      <style jsx>{`
       .target {
          width: 100px;
          height: 100vh;
          border: 1px solid blue;
          transform: translateY(-100px);
          z-index: -10;
       }
      `}</style>
    </div>
  );
}
